function hideLoaderBadges() {
    $('#loading-badges').hide();
}

function showLoaderBadges() {
    $('#loading-badges').css("visibility", "visible");
}


function showLoader2() {
    $('#loading2').css("visibility", "visible");
}

function removeCourse(e){
    var course = e.getAttribute("value"); // TODO: name of the course for information
    var icon = e.children[0];


    if(icon.classList.contains("fa-lock-open")){ // course is removed and need to be readded
        icon.classList.remove("fa-lock-open");
        icon.classList.add("fa-lock");
        e.style.color = "#1993AE"; // hide tag
    } else {
        icon.classList.remove("fa-lock");
        icon.classList.add("fa-lock-open");
        e.style.color = "gray"; // hide tag
    }  
}


// Constructing the suggestion engine
var students = new Bloodhound({
    datumTokenizer: Bloodhound.tokenizers.whitespace,
    queryTokenizer: Bloodhound.tokenizers.whitespace,
    local: students
});

// Initializing the typeahead
$('.typeahead').typeahead({
    hint: true,
    highlight: true, /* Enable substring highlighting */
    minLength: 1 /* Specify minimum characters required for showing result */
},
    {
        name: 'students',
        source: students
    }).bind("typeahead:selected", function (obj, datum, name) {
        showLoaderBadges();
        var name_student = datum.replace(/ /g, "%20");

        // Send query and return courses done by a student
        var host = window.location.hostname;

        if (host.indexOf('localhost') > -1) {
            //is development
            host = "http://" + host + ":3000";
        } else {
            // is production
            host = "https://" + host;
        }

        var courses_by_student_url = host + "/courses/?student=" + name_student;


        $.ajax({
            url: courses_by_student_url, success: function (courses_by_stud) {

                // hideLoaderBadges();
                document.getElementById("coursesbadges").innerHTML = ""; // reset

                // show badges
                courses_by_stud.forEach(course => {
                    $("#coursesbadges").append(
                        `<li style="margin-bottom: 10px;">
                            <div class="row">
                                <div class="col-1">
                                    <button type="button" class="btn buttons-icon-lock"
                                    value="${course.course_name}" onclick="removeCourse(this);">
                                        <i class="fas fa-lock"></i>
                                    </button>
                                </div>
                                <div class="col-11">
                                    ${course.course_name}
                                </div> 
                            </div>
                        </li>`
                        );
                });

                var host = window.location.hostname;
                if (host.indexOf('localhost') > -1) {
                    //is development
                    host = "http://" + host + ":3000";
                } else {
                    // is production
                    host = "https://" + host;
                }

                var personal_url = host + "/personal_graph/?student=" + name_student;

                console.log(personal_url)


                showLoaderBadges();

                function personalGraph() {
                    d3.json(personal_url, function (error, graph) {
                    if (error) throw error;

                    var width = 500;
                    var height = 500;

                    document.getElementById("personalGraph").innerHTML = "";

                    var svg = d3.select("#personalGraph")
                        .append("svg")
                        // .attr("style", "height: 500px;")
                        .attr("viewBox", [-width / 2, -10, 1200, height])
                        .attr("font-size", 8)
                        .attr("font-family", "sans-serif")
                    //     .call(d3.zoom().on("zoom", function () {
                    //         svg.attr("transform", d3.event.transform)
                    //      }))
                    //    .append("g")

                    // var color = d3.scaleOrdinal(d3.schemeCategory20);
                    var color = d3.scaleOrdinal()
                        .domain(d3.range(10))
                        .range(["#6B9AC4", "#96C9DC"])
              
                    var simulation = d3.forceSimulation()
                        .force("link", d3.forceLink().id(function (d) { return d.id; }).distance(200))
                        .force("charge", d3.forceManyBody())
                        .force("center", d3.forceCenter(width / 2, height / 2));

                    var link = svg.append("g")
                        .attr("class", "links")
                        .selectAll("line")
                        .data(graph.links)
                        .enter().append("line")
                        .attr("stroke-width", function (d) { return Math.sqrt(d.value); });

                    var node = svg.append("g")
                        .attr("class", "nodes")
                        .selectAll("g")
                        .data(graph.nodes)
                        .enter().append("g")

                    var circle = node.append("circle")
                        .attr("r", 20)
                        .attr("fill", function (d) { return color(d.taken); })
                        .call(d3.drag()
                            .on("start", dragstarted)
                            .on("drag", dragged)
                            .on("end", dragended));

                    var lables = node.append("text")
                        .text(function (d) {
                            return d.name;
                        })
                        .attr('text-anchor', 'middle')
                        .attr('x', 3)
                        .attr('y', 5);

                    node.append("title")
                        .text(function (d) { return d.name; });

                    simulation
                        .nodes(graph.nodes)
                        .on("tick", ticked);

                    simulation.force("link")
                        .links(graph.links);

                    function ticked() {
                        link
                            .attr("x1", function (d) { return d.source.x; })
                            .attr("y1", function (d) { return d.source.y; })
                            .attr("x2", function (d) { return d.target.x; })
                            .attr("y2", function (d) { return d.target.y; });

                        node
                            .attr("transform", function (d) {
                                return "translate(" + d.x + "," + d.y + ")";
                            })
                    }

                    function dragstarted(d) {
                        if (!d3.event.active) simulation.alphaTarget(0.3).restart();
                        d.fx = d.x;
                        d.fy = d.y;
                    }

                    function dragged(d) {
                        d.fx = d3.event.x;
                        d.fy = d3.event.y;
                    }

                    function dragended(d) {
                        if (!d3.event.active) simulation.alphaTarget(0);
                        d.fx = null;
                        d.fy = null;
                    }

                    hideLoaderBadges();
                    showLoader2();

                });
            }

                q.defer(personalGraph);
            }
        });
    });